llm_output:
function transfer(address recipient, uint256 amount) public returns (bool) {
    /* --------------------------------------------------------------------- */
    /*  Local cache of frequently-used state variables                       */
    /* --------------------------------------------------------------------- */
    address sender = _msgSender();                 // gas-saving alias
    uint256 taxRate      = _taxRate;               // percentage (e.g. 5 means 5%)
    bool    delayEnabled = transferDelayEnabled;   // transfer-delay switch
    address pair         = _uniswapV2Pair;         // DEX pair address

    /* --------------------------------------------------------------------- */
    /*  Anti-bot / transfer-delay logic                                      */
    /* --------------------------------------------------------------------- */
    if (delayEnabled &&
        recipient != pair &&
        sender    != pair &&
        sender    != address(this))
    {
        address origin = tx.origin;        // original EOA
        require(
            _holderLastTransferBlock[origin] < block.number,
            "_transfer:: Transfer Delay enabled. Only one purchase per block allowed."
        );
        _holderLastTransferBlock[origin] = block.number;
    }

    /* --------------------------------------------------------------------- */
    /*  Transaction & wallet size limits                                     */
    /* --------------------------------------------------------------------- */
    require(amount <= _maxTxAmount, "Exceeds the _maxTxAmount.");

    if (recipient != pair &&
        recipient != _owner &&
        recipient != address(this))
    {
        require(
            _balances[recipient] + amount <= _maxWalletSize,
            "Exceeds the max wallet size."
        );
    }

    /* --------------------------------------------------------------------- */
    /*  Fee (tax) calculation                                                */
    /* --------------------------------------------------------------------- */
    uint256 taxAmount      = (amount * taxRate) / 100;
    uint256 transferAmount = amount - taxAmount;

    /* --------------------------------------------------------------------- */
    /*  Balance updates                                                      */
    /* --------------------------------------------------------------------- */
    _balances[sender]    -= amount;
    _balances[recipient] += transferAmount;
    _balances[address(this)] += taxAmount;

    /* --------------------------------------------------------------------- */
    /*  Events                                                               */
    /* --------------------------------------------------------------------- */
    emit Transfer(sender, recipient, transferAmount);
    emit Transfer(sender, address(this), taxAmount);

    return true;
}

